    "    cog = []\n",
    "    for i in range(len(track)):\n",
    "        pix_x, pix_y = get_x_y_from_pix(track[i][0])\n",
    "        cog_x = round(np.average(pix_x), 6)\n",
    "        cog_y = round(np.average(pix_y), 6)\n",
    "        cog.append([cog_x, cog_y])\n",
    "    plt.show()\n",
    "    return cog"
